import { NavigationContainer } from '@react-navigation/native'
import { createNativeStackNavigator } from '@react-navigation/native-stack'

import { StartScreen } from './screens/start/Start'

const Stack = createNativeStackNavigator()

const defaultScreenOptions = {
    options: {
        headerShown: false,
    },
}

const App = () => {
    return (
        <NavigationContainer>
            <Stack.Navigator>
                <Stack.Screen name="Home" component={StartScreen} {...defaultScreenOptions} />
                <Stack.Screen name="Login" component={LoginScreen} {...defaultScreenOptions} />
                <Stack.Screen name="Register" component={RegisterScreen} {...defaultScreenOptions} />
            </Stack.Navigator>
        </NavigationContainer>
    )
}

export default App
